import React from 'react';
import axios from 'axios';

class Index extends React.Component {
    constructor(props) {
        super(props)

        axios.get('http://localhost:5000/main').then((res) => {
            console.log(res.json)
        })
    }

    render() {
        return <div></div>
    }
}

export default Index
